import React, { useState } from "react";


function App() {

    const x = 31;
    const[count,setCounter]=useState(x);
    const IncNum = () => {
        setCounter(count+23)
    }

    return (
        <>
          <h1>{count}</h1>
          <button onClick={IncNum}>Click Me</button> 
        </>

    );
}

export default App;
